import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import Layout from './Layout';
import ViewAbout from "./ViewAbout";
import Service from "./Service";



const App = () => {
    return ( 
        <Router>
            <Link to="/">

            </Link>    



            <Switch>
                <Route  path="/" exact>
                    <Layout />
                </Route>
                <Route  path="/viewabout">
                    <ViewAbout />
                </Route>
                <Route  path="/service">
                    <Service />
                </Route>
            </Switch>
        </Router>
        
    )
}

export default App;
